Sfotipy.Views.Album=Backbone.View.extend({tagName:"article",className:"song",events:{click:"navigate"},template:Handlebars.compile($("#album-template").html()),initialize:function(){this.listenTo(this.model,"change",this.render,this)},render:function(){var e=this.model.toJSON(),t=this.template(e);return this.$el.html(t),this},navigate:function(){Sfotipy.app.navigate("album/"+this.model.get("name"),{trigger:!0})}});